(2, 'PT Indie Syafa Transforma Resmi Luncurkan Proyek Perumahan Blue Syafa Unique, Bangun Kedekatan dengan Warga', 'Suasana penuh hangat dan kebersamaan di acara tasyakuran pembukaan proyek perumahan Blue Syafa Unique (BSU) yang digelar oleh PT Indie Syafa Transforma bersama warga RW 1, Kelurahan Pohsangit Kidul, Kecamatan Kademangan, Kota Probolinggo, Jumat (18/7).\r\nAcara yang dimulai pukul 19.00 WIB itu dihadiri ratusan warga dan menjadi momentum awal dimulainya pembangunan proyek perumahan BSU.\r\nTidak hanya sebagai seremoni, kegiatan ini juga menjadi ajang silaturahmi dan komunikasi langsung antara pengembang dan masyarakat sekitar.', 'data:image/webp;base64,', 'Admin Utama', '2026-01-20 06:25:12', 'publish');
INSERT INTO `berita` (`id_berita`, `judul`, `isi`, `gambar`, `penulis`, `tanggal_publish`, `status`) VALUES
(3, 'Konsisten Edukasi Hukum dan Transparansi, PT. Indie Syafa Transforma Sabet Penghargaan Bergengsi di Ajang Radar Surabaya Award 2025', 'PT Indie Syafa Transforma kembali mencetak prestasi gemilang dengan meraih penghargaan dalam ajang Radar Surabaya Awards 2025 sebagai Pengembang Properti yang Berkomitmen pada Edukasi Hukum Pertanahan dan Transparansi Transaksi.\r\n\r\nPenghargaan prestisius ini diserahkan dalam seremoni yang berlangsung di Ballroom Hotel Vasa Surabaya, Kamis (31/7).\r\n\r\nPenghargaan ini menjadi bukti nyata atas dedikasi PT Indie Syafa Transforma dalam menghadirkan pengembangan properti yang tidak hanya unggul secara fisik, tetapi juga berorientasi pada edukasi hukum kepada masyarakat. Perusahaan ini konsisten memberikan pemahaman mendalam kepada konsumen mengenai aspek legalitas dan kepastian hukum pertanahan dalam setiap transaksi properti.\r\n\r\nSejumlah tokoh penting tingkat nasional dan regional hadir memeriahkan acara ini, termasuk Wakil Menteri Komunikasi dan Digital RI Nezar Patria, anggota DPR dan DPD RI, Wakil Gubernur Jawa Timur Emil Elestianto Dardak, serta unsur Forkopimda Surabaya Raya.', 'data:image/webp;base64,', 'Yoga Kurniawan W', '2026-01-20 12:27:16', 'publish');

